Sample source code for "Hello world" servlet: // Import required java libraries
import java.io.*;
import javax.servlet.*;
import javax.servlet.http.*; // Extend HttpServlet class
public class HelloWorld extends HttpServlet { private String message; public void init() throws ServletException { // Do required initialization message = "Hello World"; } public void doGet(HttpServletRequest request, HttpServletResponse response) throws ServletException, IOException { // Set response content type response.setContentType("text/html"); // Actual logic goes here. PrintWriter out = response.getWriter(); out.println("<h1>" + message + "</h1>"); } public void destroy() { // do nothing. }
} Save the above file with any name say "hello.java" Compile the servlet with $ javac HelloWorld.java Create following entries in web.xml file located in "/webapps/ROOT/WEB-INF/" <servlet> <servlet-name>HelloWorld</servlet-name> <servlet-class>HelloWorld</servlet-class>
</servlet> <servlet-mapping> <servlet-name>HelloWorld</servlet-name> <url-pattern>/HelloWorld</url-pattern>
</servlet-mapping> Start tomcat server using "\bin\startup.bat" (on Windows) or "/bin/startup.sh" (on Linux/Solaris etc.) and finally type http://localhost:8080/HelloWorld in the browser's address box. If everything goes fine, you would get the following result Servlet Example More Details

