Characteristics of PHP Simplicity Efficiency Security Flexibility Familiarity Example(Hello World Program): <html> <head> <title>Hello World</title> </head> <body> <?php echo "Hello, World!";?> </body> </html> Writing the PHP code inside is called Escaping to PH. Canonical PHP Tags: The script starts with . <?php
# Here echo command is used to print
echo "Hello, world!";
?> Output: Hello, world! SGML or Short HTML Tags: These are the shortest option to initialize a PHP code. <? # Here echo command will only work if # setting is done as said before echo "Hello, world!"; ?> Output: Hello, world! ASP Style Tags: To use this we need to set the configuration of the php.ini file. These are used by Active Server Pages to describe code blocks. <%
# Can only be written if setting is turned on
# to allow %
echo "hello world";
%> Output: hello world Single line comments: #<comment> Multiline comments: /* <comment> */ PHP is case-sensitive PHP is whitespace insensitive In PHP, multiple statements can be executed simultaneously (under a single condition or loop) by using curly-braces {} <?php
$var = 50;
if ($var>0){ echo ("Positive as \n"); echo ("greater than 0");
}
?> Output: Positive as
greater than 0

