An array stores multiple values in one single variable: In PHP array() function is used to create arrays. Arrays in PHP are homogenous that means they are a collection of only one type of data. <?php
$cars = array("Volvo", "BMW", "Toyota");
echo "I like " . $cars[0] . ", " . $cars[1] . " and " . $cars[2] . ".";
?> An array is a special variable, which can hold more than one value at a time. If you have a list of items (a list of car names, for example), storing the cars in single variables could look like this: $cars1 = "Volvo";
$cars2 = "BMW";
$cars3 = "Toyota"; Get length of an array using count(): <?php
$cars = array("Volvo", "BMW", "Toyota");
echo count($cars);
?>

